import React from 'react'
import Home from './components/Home';
import Login from './components/Login';
import Main from './components/Main';
import AddPerson from './components/AddPerson';
import PlanHouse from './components/PlanHouse';
import Monitor from './components/Monitor';
import Register from './components/Register';
import AdminMain from './components/AdminMain';
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom'

function App() {

  return (
    <Router>
      <Routes>
        <Route exact path='/' element={<Home/>}>
        </Route>
        <Route exact path='/login' element={<Login/>}>
        </Route>
        <Route exact path='/register' element={<Register/>}>
        </Route>
        <Route exact path='/main' element={<Main/>}>
        </Route>
        <Route exact path='/adminmain' element={<AdminMain/>}>
        </Route>
        <Route exact path='/addperson' element={<AddPerson/>}>
        </Route>
        <Route exact path='/planner' element={<PlanHouse/>}>
        </Route>
        <Route path="/monitor/:name/:sirname/:address" element={<Monitor />}> 
        </Route>
      </Routes>
    </Router>
  )
}

export default App
